function SignUp(){

    function signUp(e){
        e.preventDefault();
        const User = {
            Name:document.getElementById("uname").value,
            email:document.getElementById("email").value,
            pass:document.getElementById("pass").value,
            img:document.getElementById("img").value,  
        }

        console.log(User);
    }
    return(
        <form>
            <input placeholder="Name" id="uname" name="uname" type="text" />
            <input placeholder="E-mail" id="email" name="email" type="email" />
            <input placeholder="Password" id="pass" name="pass" type="password" />
            <input placeholder="Choose an image" id="img" name="img" type="image" alt="just an image" />
            <button onClick={signUp}>Submit</button>
        </form>
    )
}

export default SignUp;
